import React from 'react'
import './leaderboard.css'
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const Leaderboards = () => {

  //api call for easy, medium, hard, and extreme games difficulties
  const [savedTimes, setSavedTimes] = React.useState([
    {
      dif: 'hard',
      time: 5000,
      user: 'kyle'
    },
    {
      dif: 'hard',
      time: 5500,
      user: 'john'
    },
    {
      dif: 'hard',
      time: 7000,
      user: 'phil'
    }
  ])


const tableData = savedTimes.map((match,index) => {
  return(
    <TableRow>
      <TableCell>{index+1}</TableCell>
      <TableCell align="right">{match.user}</TableCell>
      <TableCell align="right">{match.dif}</TableCell>
      <TableCell align="right">{match.time}</TableCell>
    </TableRow>
  )
  /*return (
    <tr key={match.id}>
      <td>{index+1}</td>
      <td>{match.user}</td>
      <td>{match.dif}</td>
      <td>
        <span>{("0" + Math.floor((match.time / 60000) % 60)).slice(-2)}:</span>
        <span>{("0" + Math.floor((match.time / 1000) % 60)).slice(-2)}:</span>
        <span>{("0" + ((match.time / 10) % 100)).slice(-2)}</span>
      </td>
    </tr>
  )*/
})




/*
<table className="best-game-table">
  <thead>
    <tr>
      <th>Rank</th>
      <th>Name</th>
      <th>Difficulty</th>
      <th>Time</th>
    </tr>
  </thead>
  <tbody>{tableData}</tbody>
</table>
*/

  return (
    <div className="leaderboards">
      <h1>Leaderboards</h1>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell>Rank</TableCell>
                  <TableCell align="right"></TableCell>
                  <TableCell align="right">Fat&nbsp;(g)</TableCell>
                  <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                  <TableCell align="right">Protein&nbsp;(g)</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {tableData}
              </TableBody>
            </Table>
    </div>
  )
}

export default Leaderboards;
